import 'bootstrap/dist/css/bootstrap.css'
import { useState } from 'react';
import './App.css';

function App() {
 let [num,changeNum]=useState(0)
 let change=()=>{
      changeNum(num++)
 }
 let changen=()=>{
   changeNum(num--)
 }

  return (
    <div>
      <button className='btn btn-primary m-5' onClick={change}>increment</button>
      <h1 className='text-center'>{num}</h1>
      <button className='btn btn-secondary m-5' onClick={changen} >decrement</button>
    </div>
  );
}

export default App;
